import React from 'react';

function ChangingButtons() {
  return (
    <div style={{backgroundColor: "#fafbfc"}}>
        <SideMenu></SideMenu>
        <div style={{marginLeft:'14%'}}>
          <Header></Header>
          <Main></Main>
        </div>
    </div>
  );
}

export default ChangingButtons;
